  \"2016-05-25T00:41:23.326919\",\n\t\"name\": \"mariner-outreach-data-7734e\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides MARAD with the ability
  to determine available personnel and resources in a time of emergency.  It also
  provides a portal for mariners to update contact information, and ensure that MARAD
  has the most up to date information possible. The features are: - Monitor the adequacy
  of the merchant mariner pool - Make valid vessel and human resources projections
  - Identify potential mariner shortfalls - Facilitate crewing of vessels should a
  mariner shortage occur - Mariners provide up-to-date/accurate contact information
  - Voluntary participation/no requirement to sail\",\n\t\"license_title\": \"Other
